import React, { Component } from "react";

class TeamMemberGrid extends Component {
  render() {
    /* team member data */

    let data = [
      {
        profileImage: "team-1.jpg",
        profileTitle: "Meliha Avdagić",
        profileDesignation: "Engineer | Project Management",
        profileEmail: "m.avdagic@ppg.ba",
        socialLinks: {
          facebook: "//www.facebook.com",
          twitter: "//www.twitter.com",
          linkedin: "//www.linkedin.com",
          googlePlus: "//plus.google.com",
        },
      },
      {
        profileImage: "team-2.jpg",
        profileTitle: "Nermin Šehagić",
        profileDesignation: "Engineer | Tunnel Engineer & Designer",
        profileEmail: "n.sehagic@ppg.ba",
        socialLinks: {
          facebook: "//www.facebook.com",
          twitter: "//www.twitter.com",
          linkedin: "//www.linkedin.com",
          googlePlus: "//plus.google.com",
        },
      },
      {
        profileImage: "team-3.jpg",
        profileTitle: "Nedžad Begić",
        profileDesignation: "Engineer | Design Management",
        profileEmail: " n.begic@ppg.ba",
        socialLinks: {
          facebook: "//www.facebook.com",
          twitter: "//www.twitter.com",
          linkedin: "//www.linkedin.com",
          googlePlus: "//plus.google.com",
        },
      },
      {
        profileImage: "team-4.jpg",
        profileTitle: "Daria Njemčević",
        profileDesignation: "Architect | Architecture and BIM modeling",
        profileEmail: "d.njemcevic@ppg.ba",
        socialLinks: {
          facebook: "//www.facebook.com",
          twitter: "//www.twitter.com",
          linkedin: "//www.linkedin.com",
          googlePlus: "//plus.google.com",
        },
      },
    ];

    let Datalist = data.map((val, i) => {
      return (
        <div
          className="col-lg-3 col-sm-6 col-12 section-space--bottom--30"
          key={i}
        >
          <div className="team">
            <div className="image">
              <img src={`assets/img/team/${val.profileImage}`} alt="" />
            </div>
            <div className="content">
              <h3 className="title">{val.profileTitle}</h3>
              <span>{val.profileDesignation}</span>
              <a href={"mailto:" + val.profileEmail} className="email">
                {val.profileEmail}
              </a>
              <div className="social">
                <a href={val.socialLinks.facebook} className="facebook">
                  <i className="fa fa-facebook" />
                </a>
                <a href={val.socialLinks.twitter} className="twitter">
                  <i className="fa fa-twitter" />
                </a>
                <a href={val.socialLinks.linkedin} className="linkedin">
                  <i className="fa fa-linkedin" />
                </a>
                <a href={val.socialLinks.googlePlus} className="google">
                  <i className="fa fa-google-plus" />
                </a>
              </div>
            </div>
          </div>
        </div>
      );
    });
    return (
      <div>
        {/*====================  team member area ====================*/}
        <div className="team-member-area section-space--inner--120">
          <div className="container">
            <div className="row">
              <div className="col-lg-12">
                <div className="section-title-area text-center">
                  <h2 className="section-title section-space--bottom--50">
                    Key Personel
                    <span className="title-icon" />
                  </h2>
                </div>
              </div>
            </div>
            <div className="row">
              <div className="col-lg-12">
                <div className="team-member-wrapper">
                  <div className="row">
                    {/* team member list */}
                    {Datalist}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        {/*====================  End of team member area  ====================*/}
      </div>
    );
  }
}

export default TeamMemberGrid;
